import React from "react";
import "./Header.css";
import { Link } from "react-router-dom";
function Header() {
  return (
    <nav className="header">
      {/* Logo on the left*/}
      <Link to="/">
        <img
          className="header__logo"
          src="http://pngimg.com/uploads/amazon/amazon_PNG11.png"
          alt=""
        />
      </Link>
      {/*Search box */}
    </nav>
  );
}

export default Header;
